import React from 'react'
import { Card } from 'react-bootstrap'

const ProductCard = ({fProduct}) => {
  return (
    <Card>
        <Card.Img src={fProduct.image}></Card.Img>
        <Card.Body>
          <Card.Title>{fProduct.name}</Card.Title>
        </Card.Body>
    </Card>
  )
}

export default ProductCard
